import React, { Component } from 'react'

export default class Us extends Component {
    state = { kategori :[
        {  id:1, name : "Ayakkabı" },
        {  id:1, name : "T-shirt" },
        {  id:1, name : "Pantolon" },
        {  id:1, name : "Sweat" }
    ]
        }
       
    
    
    
  render() {
    return (
      <div className='user'>

        {
            this.state.map(kategori => {
                <li id ={kategori.id}> {kategori.name} </li>
                
            })
        }
         

      </div>
    )
  }
}
